import React from "react";
import "./Message.css";

const Message = ({ msg, chat }) => {
  console.log(msg);
  console.log(chat);
  return (
    <div className="message-wrapper">
      {msg.media ? (
        <img
          src={msg.media}
          style={{
            width: "100px",
            height: "100px",
            borderRadius: "5px",
            objectFit: "cover",
          }}
        />
      ) : null}
      {msg.text}
    </div>
  );
};

export default Message;
